import React from 'react';
import '@fortawesome/fontawesome-free/css/all.min.css';
import { Link, useLocation } from 'react-router-dom';

function Soal() {
    let hasCompletedExam1 = false; 

    const toggleSidebar = () => {
        const sidebar = document.getElementById("sidebar");
        sidebar.classList.toggle("w-14");
        sidebar.classList.toggle("w-56");

        const navTexts = sidebar.querySelectorAll('.nav-text');
        navTexts.forEach(text => {
            text.classList.toggle('hidden');
        });
    };

    const showConfirmation = (ujianName) => {
        const popup = document.getElementById("confirmationPopup");
        popup.classList.remove("hidden");

        const confirmBtn = document.getElementById("confirmBtn");
        confirmBtn.onclick = function() {
            alert("Anda memulai " + ujianName);
            closePopup();
            // Tambahkan logika untuk memulai ujian di sini
        };
    };

    const showNotification = (message) => {
        const notificationPopup = document.getElementById("notificationPopup");
        const notificationMessage = document.getElementById("notificationMessage");
        notificationMessage.innerText = message;
        notificationPopup.classList.remove("hidden");
    };

    const closePopup = () => {
        const popup = document.getElementById("confirmationPopup");
        popup.classList.add("hidden");
    };

    const closeNotification = () => {
        const notificationPopup = document.getElementById("notificationPopup");
        notificationPopup.classList.add("hidden");
    };

    const checkExamCompletion = (ujianName) => {
        if (!hasCompletedExam1) {
            showNotification("Anda belum mengerjakan Ujian 1");
        } else {
            showConfirmation(ujianName);
        }
    };

    const handleButtonClick = (ujianName) => {
        if (ujianName === "Ujian 1") {
            hasCompletedExam1 = true; // Anggap bahwa ujian 1 sudah dikerjakan
        }
        checkExamCompletion(ujianName);
    };

    return (
        <div className="flex min-h-screen bg-gray-100">
            <div className="sidebar bg-blue-500 flex flex-col items-center justify-between py-5 px-0 fixed left-10 top-1/2 transform -translate-y-1/2 h-[95%] w-14 rounded-lg transition-all duration-300" id="sidebar">
                <button className="toggle-btn mb-5" onClick={toggleSidebar}>
                    <i className="fas fa-bars text-white text-2xl"></i>
                </button>
                <Link to="#" className="nav-item flex items-center justify-start w-full py-2 px-4 mb-5 text-white transition-colors duration-300" onClick={() => handleButtonClick("Ujian 1")}>
                    <i className="fas fa-file-alt text-2xl mr-2"></i>
                    <span className="nav-text hidden text-base">Soal Ujian</span>
                </Link>
                <Link to="/logout" className="nav-item logout mt-auto flex items-center justify-start w-full py-2 px-4 text-white transition-colors duration-300">
                    <i className="fas fa-sign-out-alt text-2xl mr-2"></i>
                    <span className="nav-text hidden text-base">Logout</span>
                </Link>
            </div>

            <div className="container flex-1 ml-20 p-10">
                <h2 className="text-3xl mb-6">Soal Ujian</h2>
                <div className="absolute top-5 right-12 mt-6 ml-5">
                    <i className="fas fa-user text-2xl"></i>
                </div>
                <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
                    {["Ujian 1", "Ujian 2", "Ujian 3", "Ujian 4"].map((ujian) => (
                        <div key={ujian} className="card bg-white p-6 rounded-lg shadow-md">
                            <h3 className="text-xl font-bold mb-2">{ujian}</h3>
                            <p>Waktu: 60 Menit<br />Jumlah Soal: 50</p>
                            <button className="mt-4 bg-black text-white py-2 px-4 rounded hover:bg-gray-800" onClick={() => handleButtonClick(ujian)}>Mulai</button>
                        </div>
                    ))}
                </div>
            </div>

            <div id="confirmationPopup" className="fixed inset-0 flex items-center justify-center bg-black bg-opacity-50 hidden">
                <div className="bg-white rounded-lg p-5 text-center">
                    <h3 className="text-lg font-bold mb-3">Apakah Anda ingin memulai ujian?</h3>
                    <div>
                        <button className="bg-green-500 text-white px-4 py-2 rounded mr-2" id="confirmBtn">Ya</button>
                        <button className="bg-red-500 text-white px-4 py-2 rounded" onClick={closePopup}>Tidak</button>
                    </div>
                </div>
            </div>

            <div id="notificationPopup" className="fixed inset-0 flex items-center justify-center bg-black bg-opacity-50 hidden">
                <div className="bg-white rounded-lg p-5 text-center">
                    <h3 className="text-lg font-bold mb-3" id="notificationMessage"></h3>
                    <button className="bg-blue-500 text-white px-4 py-2 rounded" onClick={closeNotification}>OK</button>
                </div>
            </div>
        </div>
    );
}

export default Soal;
